// Footer.js

import React from 'react';
import { SocialIcon } from 'react-social-icons';
import './Footer.css';

const Footer = () => {
  const fgColor = '#54aeff'; // Set the desired foreground color for all icons

  return (
    <footer className="footer">
      <div className="left-section">
        <p>&copy; 2024 Your Name</p>
      </div>
      <div className="right-section">
        {/* Apply inline styles for fgColor to all SocialIcon components */}
        <SocialIcon style={{ color: fgColor }} url="https://linkedin.com/in/sajjademon" target="_blank" />
        <SocialIcon style={{ color: fgColor }} url="https://twitter.com/sajjdemon" target="_blank" />
        <SocialIcon style={{ color: fgColor }} url="https://instagram.com/sajjdemon" target="_blank" />
        <SocialIcon style={{ color: fgColor }} url="https://youtube.com/c/sajjdemon" target="_blank" />
        <SocialIcon style={{ color: fgColor }} url="https://facebook.com/sajjaademon" target="_blank" />
        <SocialIcon style={{ color: fgColor }} url="https://github.com/ignite312" target="_blank" />
      </div>
    </footer>
  );
};

export default Footer;
